import React, {useEffect} from 'react'

useEffect(() => {
   fetch("https://jsonplaceholder.typicode.com/posts")
   .then(Response => Response.json())
   .then(data=> console)

})

const PostList = () => {
  return (
    <div>PostList</div>
  )
}

export default PostList
